import React, {useEffect, useState} from 'react';
import './App.css';


function App(){
  // init variable for data from backend
  const [backendData, setBackendData] = useState([{}])

  // retreiving data from backend api

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      // setting const data variable from retrived data
      data => {
        setBackendData(data)
      }
    )
  }, [])

  return(
    <div className = "App">
        <h1> enter a number below </h1>
        <input type = "text" />
    </div>

  )
}

export default App
